using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class RoofInsulationModel : Notifier	{		public RoofInsulationModel()		{					Required = "";			Thickness = "";			Density = "";			Type = "";		}				private string _Required;		public string Required			{				get { return _Required; }				set				{					_Required = value;					OnPropertyChanged(nameof(Required));				}			}				private string _Thickness;		public string Thickness			{				get { return _Thickness; }				set				{					_Thickness = value;					OnPropertyChanged(nameof(Thickness));				}			}				private string _Density;		public string Density			{				get { return _Density; }				set				{					_Density = value;					OnPropertyChanged(nameof(Density));				}			}				private string _Type;		public string Type			{				get { return _Type; }				set				{					_Type = value;					OnPropertyChanged(nameof(Type));				}			}			}}